description:
(Note: two of the songs in this collection are .flac files! If you are using Windows Media Player, click the &quot;install.exe&quot; in the &quot;madflac&quot; folder, included in this torrent to allow WMP to play .flac files.)

This is a crazy collection of orchestrated video game music. About 75% of it is played by an actual symphony orchestra, and the rest are high quality midi files made to sound like an orchestra (bet you can't tell the difference). I suggest you make a playlist in the order shown below. Enjoy!

(Note 2: I don't own the rights to ANY of this music, I just compiled it!)

